INSERT INTO `articles` (`id`, `title`, `text`, `date`, `stat`) VALUES
(1, 'به کد اهمیت بدهید', '<p>نیازی نیست شرلوک هلمز باشید تا بدانید یک برنامه خوب به کدهای خوب نیاز دارد و یک برنامه بد به کدهای بد. برنامه های بد شلوغی به همراه دارند باید مرتب شوند. شما می خوای یه برنامه نویس خوب باشی نه ؟؟</p>                         <p>کدنویسی خوب از آسمان نازل نمی شود و با شانس هم به دست نمی آید. برای کد خوب باید روی آن کار کنید و کد خوب وقتی به دست می آید که تو به آن اهمیت بدهی.</p>                         <p class="key"><i class="fa fa-check"></i> برای یک کد خوب باید به آن اهمیت بدهی و برای یک برنامه نویس بهتر شدن  باید زمان و مکان را سرمایه گذاری کنی</p>                         <p>برنامه نویسی خوب فقط از طلاحیت تکنیکی به دست نمی آید. من برنامه نویس های بسیار با استعدادی را دیده ام که الگوریتم های بسیار قابل توجهی طراحی می کنند و چارچوب های زبان برنامه نویسی خود را به خوبی می شناسند ولی بدترین کدها را می نویسند. دردناک برای خواندن، دردناک برای استفاده کردن و دردناک برای اصلاح کردن. منبرنامه نویس های معمولی را دیده ام که با کدهای ساده برنامه های بسیار خوبی می نویسند که کارکردن با آن ها لذت بخش است.</p>                         <p>بر اساس تجارب من در محیط کار به این نتیجه رسیده ام که تفاوت بین برنامه نویس معمولی و برنامه نویس عالی یک چیز است. نگرش برنامه نویسی خوب بستگی به انتخاب روش حرفه ای و خواستن برای نوشتن نرم افزار خوب دادرد بر اساس محدودیت و فشارهای شرکت های نرم افزاری .</p>                         <p>برای تبدیل شدن به یک برنامه نویس خوب باید با نیت خوب عمل کنی و به کد اهمیت بدهی و یک نگرش سالم را به دست بیاوری. کد خوب با دقت توسط یک معمار خوب طراحی می شود.</p>                         <p>نه از طریق هک کردن یک برنامه نا منظم یا بنا شدن توسط یک خودشیفته. اگر می خواهی کد خوب بنویسی و یک برنامه نویس خوب باشی باید به کد اهمیت بدهی و این یعنی با دقت عمل کنی. برای مثال :</p>                         <p class="bullet"><i class="fa fa-circle"></i> در هر شرایطی که نیاز به کد نوشتن است از نوشتن چیزی که ممکن است کار کند خودداری کنید. شما باید تلاش کنید تا کدی بنویسید که دقیقا درست باشد و آن را نشان بدهد.</p>                         <p class="bullet">باید کدی بنویسید که قصد شما را به خوبی نشان دهد (برنامه نویس های دیگر آن را بفهمند). قابل اصلاح باشد(شما یا سایر برنامه نویس ها به راحتی آن را در آینده اصلاح کنند) و درست باشد (شما تمام قدم ها را با دقت انجام دهید تا برنامه درست اجرا شود نه فقط در ظاهر درست باشد)</p>                         <p class="bullet">در کنار بقیه برنامه نویس ها به خوبی کار کنید. تعداد کمی از برنامه نویس ها تنها کار می کنند و اکثرا به صورت تیم کار می کنند یا در محیط یک شرکت یا برای کار بر روی یک پروژه open source شما باید بقیه ی برنامه نویس ها را هم مدنظر قرار دهید و باید کدهایی را بنویسید که با بقیه هماهنگ باشد. شما باید تلاش کنید که تیم، یک نرم افزار خوب طراحی کند تا اینکه خودتان باهوش به نظر برسید.</p>                         <p class="bullet">هر وقت که به کدی رسیدی باید تلاش کنی آن را بهبود ببخشی</p>                         <p class="bullet">اهمیت دادن به برنامه و کد باعث می شود که شما دائما در حال یادگیری زبان های جدید، اصلاحات و تکنیک ها باشی . ولی باید از آن ها فقط در موارد مناسب استفاده کنید.</p>                         <p>خوشبختانه شما این مقاله را می خوانید چون به کد اهمیت می دهی و شما را مورد توجه قرار می دهد و هدف شماست. شما دوست دارید که درست انجامش دهید پس به خواندن ادامه دهید تا ببینید چگونه این علاقه شما را تبدیل به عمل می کنیم.</p>                         <p>در حین انجام دادن این کارها یادتان نرود که خوش بگذرانید. از کم کردن کدها و استفاده از آن ها برای حل مشکلات پیچیده لذت ببرید و برنامه ای بسازید که به آن افتخار کنید.</p>                         <P class="key"><i class="fa fa-check"></i>هیچ چیز بدی در رابطه با احساس داشتن به کد وجود ندارد. افتخار به کدنویسی سالم و انزجار از کدنویسی بد بسیار مفید است.</P>', 1425770072, 1);
